<!doctype html>
<html lang="en">
<head>
    <title>Interactive Map</title>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.0.0-beta/css/bootstrap.min.css">
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.2.0/dist/leaflet.css">
    <link rel="icon" href="data:;base64,iVBORw0KGgo=">
    <link rel="stylesheet" type="text/css" href="https://cdn.jsdelivr.net/npm/daterangepicker/daterangepicker.css" />
    <style>
    @media only screen and (min-width:600px){
        html,body {
            height:100%;
        }
        .flex-fill {
            flex: 1;
        }
        .map{height:600px}
        .my-div-icon{
            background-color:#fd8424;border-radius:3px;
            border:2px solid #ca6a1b
            }
            .my-div-icon{
                height:0;width:0;background-color:rgba(0,0,0,0)
                ;border-radius:40%;border-style:none
                }
            .input {
                width: 10vw;
            }
            #selecteddate{
                float: right;
                position:absolute;
                z-index:1001; top: 0;
                top: 95%;
                left:3%;
                font-size:3vh;
            }
            .fontsz {
                font-size: 2vh;
            }
            }
        @media only screen and (max-width:600px){
            .map{
                height: 300px;
                margin: 0;
                padding: 0;
                }
            .my-div-icon{
                background-color:#fd8424;
                border-radius:3px;
                border:2px solid #ca6a1b;
                }
            .my-div-icon{
                height:0;
                width:0;
                background-color:rgba(0,0,0,0);
                border-radius:40%;
                border-style:none}
              
            .input {
                width: 15vh;
            }
            #selecteddate{
                float: right;
                position:absolute;
                z-index:1001; top: 0;
                left:25%;
                font-size:5vh
            }
            .fontsz {
                font-size: 4vh;
            }  
            }
        .btn1{
            background-color: #008CBA;
        }
        .btn2{
            background-color: #f44336;
        }
        .btn3{
            background-color: #4CAF50;
        }
        .selectedbtn{
            /* background-color: grey; */
             box-shadow: 0 8px 16px 0 rgba(0,0,0,0.2), 0 6px 20px 0 rgba(0,0,0,0.19);
             border: 2px solid grey; /* Green */
             /* color: white; */
        }
        .unselectedbtn{
            background-color: whitesmoke;
            color: black;
        }
        /* The Modal (background) */
        .modal {
        display: none; /* Hidden by default */
        position: fixed; /* Stay in place */
        z-index: 10000; /* Sit on top */
        padding-top: 100px; /* Location of the box */
        left: 0;
        top: 0;
        width: 100%; /* Full width */
        height: 100%; /* Full height */
        overflow: auto; /* Enable scroll if needed */
        background-color: rgb(0,0,0); /* Fallback color */
        background-color: rgba(0,0,0,0.4); /* Black w/ opacity */
        }
        /* Modal Content */
        .modal-content {
        background-color: #fefefe;
        margin: auto;
        padding: 20px;
        border: 1px solid #888;
        width: 80%;
        }
        /* The Close Button */
        .close {
        color: #aaaaaa;
        float: right;
        font-size: 28px;
        font-weight: bold;
        }
        .close:hover,
        .close:focus {
        color: #000;
        text-decoration: none;
        cursor: pointer;
        }
    </style>
</head>
<body class="fontsz">
    <div id="app" class="container-fluid d-flex h-100 flex-column" style="margin: 0; padding:0;">
        <nav class="navbar navbar-expand-lg navbar-light "   style="background-color: #29434e !important;  ">
            <a class="navbar-brand" href="#"><span style=" color:white; font-weight: bold;">Climatología de Puerto Rico</span> </a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup"
                aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                <div class="navbar-nav">
                    <a class="nav-item nav-link active" href="#"><span class="sr-only">(current)</span></a>
                    <a class="nav-item nav-link" href="#"></a>
                    <a class="nav-item nav-link" href="#"></a>
                    <a class="nav-item nav-link disabled" href="#"></a>
                </div>
            </div>
        </nav>
         <header style="margin-bottom: 1vh;">
        <div class="row">
            <div class="col">
                <div class="d-flex" style="padding: 0;"> <img src="wenhao-ryan-jEUEpfjpe6Q-unsplash.jpg" alt="margin:0;" height="400hv" width="100%"></div>
            </div>
        </div>
        </header>
            <div class="container-fluid d-flex h-100 flex-column" >
                <div class="row justify-content-center">
                    <div class="col">
                        <div id="map" class="map" style="z-index:1000;"></div>
                        <h5 id="selecteddate" style=""> </h5>
                        <!-- contenedor de graficos-->
                        <div id="rangeModal" class="modal">
                            <!-- Modal content -->
                            <div class="modal-content">
                                <span class="close">&times;</span>
                                <canvas id="myChart" width="400" height="150"></canvas>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-3" style="background-color:rgba(201, 201, 201, 0.212); margin-left:10px; ">
                        <h3 class="fontsz">Filtros:</h3>
                        <div class="form-check"  v-for="layer in layers" :key="layer.id">
                            <label class="form-check-label" >
                                <input class="form-check-input" type="checkbox" v-model="layer.active"  @change="layerChanged(layer.id, layer.active)" />
                                {{ layer.name }}
                            </label>
                            <hr>
                        </div>
                        <div class="col-md-auto">
                            <div class="col-12">
                                <label for="dateType" ><h3 class="fontsz">Fecha</h3></label>
                                <select id="dateType" v-on:change="dateType($event)">
                                <option value="singleDate"><h1>Un dia</h1></option>
                                <option value="rangeDate">Por Rango</option>
                                </select>
                            </div>
                            <div v-show="singleDate" class="col-12">
                                <input type="text" id="singleDate" name="birthday"  class="input" style="width: 304px; text-align: center;" />
                           </div>
                           <div v-show="rangeDate" class="col-12">
                                <input type="text" id="calendar" name="datetimes" class="input" style="width: 304px; text-align: center;"/>
                           </div>
                        </div>                  
                        <hr>
                        <div  class="col-12" style="margin-top: 1em;">
                            <h3 class="fontsz">Variables:</h3>
                            <button  id="btn1" @click="setPins('prcp', startdate, enddate), toogle('btn1',['btn2','btn3'])" type="button" class="btn1 btn-block " ><span class="fontsz">Precipitación </span></button>
                            <button  id="btn2" @click="setPins('tmax', startdate, enddate), toogle('btn2',['btn1','btn3'])" type="button" class="btn2 btn-block "><span class="fontsz">Temperatura Máxima </span></button>
                            <button  id="btn3" @click="setPins('tmin', startdate, enddate), toogle('btn3',['btn1','btn2'])" type="button" class="btn3 btn-block "><span class="fontsz">Temperatura Mínima</span></button>
                            <hr>
                           <div v-show="singleDate" class="col-12">
                                <button @click="  updatePins(document.getElementById('singleDate').value + '-' + document.getElementById('singleDate').value)" type="button" class="btn-secondary btn-block"><span class="fontsz">OK</span></button>
                           </div>
                           <div v-show="rangeDate" class="col-12">
                                <button @click=" updatePins(document.getElementById('calendar').value)" type="button" class="btn-secondary btn-block"><span class="fontsz">OK</span></button>
                           </div>
                        </div>
                    </div>          
                </div>
        </div>
        <footer style="background-color: #000a12 !important; margin-top: 0.4rem; height: 6vh;"></footer>
    </div>
<script type="text/javascript" src="https://cdn.jsdelivr.net/jquery/latest/jquery.min.js"></script>
<script type="text/javascript" src="https://cdn.jsdelivr.net/momentjs/latest/moment.min.js"></script>
<script type="text/javascript" src="https://cdn.jsdelivr.net/npm/daterangepicker/daterangepicker.min.js"></script>
<script>
      //single date picker
        $(function() {
            $('input[name="birthday"]').daterangepicker({
                singleDatePicker: true,
                showDropdowns: true,
                startDate: '04-04-2018',
                minYear: 2001,
                maxYear: parseInt(moment().format('YYYY'),10),
                "minDate": "01-01-2001",
                "maxDate": moment().subtract(1, 'days')
            });
        });
    // range date picker
      $(function () {
          $('input[name="datetimes"]').daterangepicker({
               "showDropdowns": true,
                "minYear": 2001,
                "maxYear": 2020,
                "autoApply": true,
                // "minDate": "01/01/2001",
                // "maxDate": "09/30/2019",
                // "opens": "center"
            });   
        });
   
</script>

    methods:{
        /**
        * initialize leafletjs map instace 
        **/
        initMap:function () {
            // select the DOM element with the 'map' id to instanciate the leafletjs map instance
            this.map= L.map('map').setView([18.135412,-66.450806],9.2);
            // instanciate the map tile, layer currently using the openstreet map layer
            this.tileLayer= L.tileLayer('https://cartodb-basemaps-{s}.global.ssl.fastly.net/rastertiles/voyager/{z}/{x}/{y}.png',
                             {maxZoom:18,attribution:'&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>, &copy; <a href="https://carto.com/attribution">CARTO</a>',});
            // add the tile layer instance to the map instance 
            this.tileLayer.addTo(this.map);
            // set the current pin view of the map instance to precipitation with start date and end date of the variable date 
            this.setPins('prcp',this.date,this.date);
            // update the map date lable, a DOM element with id 'selecteddate' to the current showed date of the pins
            document.getElementById('selecteddate').innerHTML = this.date;
        },
        /**
        *
        **/
        initLayers:function () {
            // iterates over all layer elemts of the layers array instance variable
            this.layers.forEach((layer) => {
                // filter the elements of type feature equals polygon
                const polygonFeatures=layer.features.filter(feature => feature.type === 'polygon');
                // iterates over each polygon feature in the layer element 
                polygonFeatures.forEach((feature)=>{
                    // creates a leaflet object of the polygon of the feature using
                    // the coordinates and color as wll as binding the name to a tooltip 
                    feature.leafletObject= L.polygon(feature.coords,feature.color).bindPopup(feature.name);
                });
            });
        },
        /**
        *  add and removes layers from map based on the active param value, which is the active property of the layer element
        **/
        layerChanged:function (layerId,active) {
            const layer=this.layers.find(layer=>layer.id===layerId);
            layer.features.forEach((feature)=>{
                if (active){
                    feature.leafletObject.addTo(this.map);
                }else{
                    feature.leafletObject.removeFrom(this.map);
                }
            });
        },
        /**
        * get pin colors rgb values for temperature 
        * rgb: object instance consisting of key value of the rgb ({r,g,b})
        * temperature: int value of the temperature 
        **/
        getTemperaturePinColors:function (rgb,temperature) {
            if(temperature==null){
                rgb.r=255;rgb.g=255;rgb.b=255;
            }else if (temperature>=0&&temperature<40) {
                rgb.r=0;rgb.g=100;rgb.b=255;
            }else if (temperature>=40&& temperature<=70) {
                rgb.r=((temperature-40)/(70-40))*(100)+0;rgb.g=((temperature-40)/(70-40))*(255-100)+100;rgb.b=((temperature-40)/(70-40))*(255-255)+255;
            }else if (temperature>70&&temperature<=80) {
                rgb.r=((temperature-70)/(80-70))*(255-100)+100;rgb.g =((temperature-70)/(80-70))*(255-255)+255;rgb.b=((temperature-70)/(70-40))*(255-0)+0;
            }else if (temperature>80&&temperature<=90) {
                rgb.r=((temperature-80)/(90-80))*(255-255)+255;rgb.g=((temperature-80)/(90-80))*(255-0)+0;rgb.b=((temperature-80)/(90-80))*(8-0)+0;
            }else if(temperature>90&&temperature<=120){
                rgb.r=((temperature-90)/(120-90))*(255-100)+100;rgb.g = 0;rgb.b = 0;
            }
        },
        /**
        * get pin colors rgb values for precipitation 
        * rgb: object instance consisting of key value of the rgb ({r,g,b})
        * prcp: int value of the precipitation
        **/
        getPrecipitationPinColors: function (rgb, prcp) {
            if (prcp >= 0 && prcp <= 0.4) {
                rgb.r=(((255-0)*(0.4-prcp))/(0.4-0));
                rgb.g=255;
                rgb.b = 255;
            }else if (prcp>0.4&&prcp <=4.0) {
                rgb.r=0;
                rgb.g=(((255-0)*(4-prcp))/(4-0.4));
                rgb.b=255;
            }else if (prcp > 4 && prcp <= 24) {
                rgb.r=0;
                rgb.g=0;
                rgb.b=(((255-100)*(24-prcp))/(24-4)) + 100;
            }else if (prcp > 24) {
                rgb.r = 100;
                rgb.g = 0;
                rgb.b = 0;
            }else if (prcp == null) {
                rgb.r = 0;
                rgb.g = 0;
                rgb.b = 0;
                }

            },
        /**
        * returns a color hex value based on the view type and range value 
        **/
        getColor: function (d) {
                return d > 1000 ? '#800026' :
                        d > 500  ? '#BD0026' :
                        d > 200  ? '#E31A1C' :
                        d > 100  ? '#FC4E2A' :
                        d > 50   ? '#FD8D3C' :
                        d > 20   ? '#FEB24C' :
                        d > 10   ? '#FED976' :
                                    '#FFEDA0';
        },

            var year2 = (this.rangeDate? date.substring(19, 23) : date.substring(6, 10));


            this.setPins(this.currentPinView, (year + '-' + month + '-' + day), ( year2 + '-' + month2 + '-' + day2));

            (this.rangeDate? document.getElementById('selecteddate').innerHTML = 'Desde: ' +  month + '/' + day + '/' +  year + ' '  + 'Hasta: ' + month2 + '/' + day2 + '/' + year2 : document.getElementById('selecteddate').innerHTML = day + '/' + month + '/' + year );
        },
        /**
        * change a button propeties to make it look pressed
        **/
        toogle: function (id,btnlist) {
            for(var i = 0; i< btnlist.length;i++){
            document.getElementById(btnlist[i]).classList.remove('selectedbtn');
            document.getElementById(btnlist[i]).classList.add(btnlist[i]);
            }
            document.getElementById(id).classList.remove(id);
            document.getElementById(id).classList.add('selectedbtn');
        },
        /**
        * set the type of date to true 
        **/
        dateType: function(event) {
            if (event.target.value == 'singleDate') { 
                this.singleDate = true
                this.rangeDate = false
            }
            else if( event.target.value == 'rangeDate') { 
                this.rangeDate= true
                this.singleDate= false
            }
        },
        /**
        * close range modal
        **/
        closeRangeModal: function () {
            this.rangeModal.style.display = "none";
        },
        /**
        *
        **/
        openModal: function (modalId, spanClass) {
            var modal = document.getElementById(modalId);
            modal.style.display = 'block';
            var span = document.getElementsByClassName(spanClass)[0];
            span.onclick = function () {
              modal.style.display = 'none';
            }

            // When the user clicks anywhere outside of the modal, close it
            window.onclick = function (event) {
                if (event.target == modal) {
                    modal.style.display = 'none';
                }
            }
        },
        setChart: async function (modalId, spanClass, charttype, title, labelName, stationID, color) {
            //since the button is in the HTML dialog  intances are used instead of passing parameters throught a function call 
            var modal = document.getElementById(modalId);
            modal.style.display = 'block';
            var span = document.getElementsByClassName(spanClass)[0];

            var config=null;
            var stationLabels =[]
            var dataSetResponse = await fetch('http://climatologia.uprm.edu:8008/api?' + 'q=data&' + 'calc=none' + '&station='+ stationID + '&startdate='  + this.startdate + '&enddate=' + this.enddate + '&elem=' + this.currentPinView).catch(function (error) { alert (error); });
            var stationsDataSet = await dataSetResponse.json();
            console.log(stationsDataSet);
            // var dataSet = stationsDataSet.filter(function(station) {
            //     return station.STATIONID == stationID 
            // });
            var formatedDataSet = []
            for (i in stationsDataSet) {
                var temp = new Object();
                     
                    temp['y'] = stationsDataSet[i].VALUE;
                    stationLabels.push(stationsDataSet[i].DATE.substring(0,16));
                    formatedDataSet.push(temp);
            }
            switch(charttype) {
                case 'line':
                    config =  {
                        type: 'line',
                        data: {
                            labels: stationLabels,
                            datasets: [{
                                label: labelName,
                                backgroundColor: color,
                                borderColor: color,
                                data: formatedDataSet,
                                fill: false,
                            }]
                        },
                        options: {
                            responsive: true,
                            title: {
                                display: true,
                                text: title,
                                fontColor: '#000'
                            },
                            tooltips: {
                                mode: 'index',
                                intersect: false,
                            },
                            animation: {
                                duration: 0 
                            },
                            hover: {
                                // mode: 'nearest',
                                // intersect: true
                                animationDuration: 0
                            },
                            responsiveAnimationDuration: 0,
                            scales: {
                                xAxes: [{
                                    display: true,
                                    scaleLabel: {
                                        display: true,
                                        labelString: 'Fecha',
                                        fontStyle: 'bold',
                                        fontColor: '#000'
                                    },
                                    ticks: {
                                        source: 'labels',
                                        autoSkip: true
                                    }
                                }],
                                yAxes: [{
                                    display: true,
                                    scaleLabel: {
                                        display: true,
                                        labelString: 'Valor (ºF)',
                                        fontStyle: 'bold',
                                        fontColor: '#000'
                                    }
                                }]
                            }
                        }
                    };
                    break;
                default: 
                config = {
                    type: 'bar',
                    data: {
                        labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                        datasets: [{
                            label: '# of Votes',
                            data: [12, 19, 3, 5, 2, 3],
                            backgroundColor: [
                                'rgba(255, 99, 132, 0.2)',
                                'rgba(54, 162, 235, 0.2)',
                                'rgba(255, 206, 86, 0.2)',
                                'rgba(75, 192, 192, 0.2)',
                                'rgba(153, 102, 255, 0.2)',
                                'rgba(255, 159, 64, 0.2)'
                            ],
                            borderColor: [
                                'rgba(255, 99, 132, 1)',
                                'rgba(54, 162, 235, 1)',
                                'rgba(255, 206, 86, 1)',
                                'rgba(75, 192, 192, 1)',
                                'rgba(153, 102, 255, 1)',
                                'rgba(255, 159, 64, 1)'
                            ],
                            borderWidth: 1
                        }]
                    },
                    options: {
                        scales: {
                            yAxes: [{
                                ticks: {
                                    beginAtZero: true
                                }
                            }]
                        }
                    }
                }

            }
            
            var ctx = document.getElementById('myChart').getContext('2d');
            var myChart = new Chart(ctx, config);

            span.onclick = function () {
              modal.style.display = 'none';
              myChart.destroy();
            }
            // When the user clicks anywhere outside of the modal, close it
            window.onclick = function (event) {
                if (event.target == modal) {
                    modal.style.display = 'none';
                    myChart.destroy();
                }
            }

        }
    },
    watch: {
        'range': function (val) {
            this.updatePins(val);
        }
    }
});
//code outside VM instance
    function myFunction(charttype, title, labelName,stationID,color) {
        // vm.openModal('rangeModal', 'close');
        vm.setChart( 'rangeModal', 'close',charttype, title, labelName, stationID, color);
    }
</script>
